import React from 'react';

function YourBotArmy({ enlistedBots }) {
  return (
    <div>
      {enlistedBots.map(bot => (
        <div key={bot.id}>
          <h2>{bot.name}</h2>
          <p>{bot.description}</p>
        </div>
      ))}
    </div>
  );
}

export default YourBotArmy;
